import React from "react";

class ExperienceResp extends React.Component {
  render() {
    return (
      <div
        id="experience"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Experience</div>
        </div>
        <div
          className="container"
          style={{
            // backgroundColor: "#F1F2F2",
            backgroundColor: "white",
            padding: "1%",
            borderRadius: "10px",
          }}
        >
          <div style={Content}>
            <div className="Ex" data-aos="zoom-in" style={WorkExdivs}>
            <div
                style={{
                  width: "150px",
                  height: "150px",
                  justifyContent: "space-between",
                  alignItems: "center",
                  display: "flex",
                  flexDirection: "column",
                }}
              >
                <img
                  alt="companylogo"
                  style={{ maxWidth: "70%", maxHeight: "70%" }}
                  src={require("../Icons/Icons-06.png")}
                />
                <div
                  style={{
                    fontSize: "15px",
                    color: "#193964",
                    fontWeight: "bold",
                  }}
                >
                  2019
                </div>
              </div>
              <div className="ExpSub">
                <ul>
                  <li>
                    Khoury College of Computer Sciences – Designed course
                    material and exams for Introduction to Web Development.
                  </li>
                  <li>
                    Facilitated doubt solving sessions and assisted with
                    grading.
                  </li>
                </ul>
              </div>
            </div>
            <div className="Ex" data-aos="zoom-in" style={WorkExdivs}>
              <div style={{ width: "100px", height: "100px" }}>
                <img
                  alt="companylogo"
                  style={{ maxWidth: "80%", maxHeight: "80%" }}
                  src={require("../Icons/Icons-06.png")}
                />
              </div>
              <div className="ExpSub">
                content <br /> here <br />
                jgdnfbxfn
                <br /> ngdngd <br />
                jgfj
              </div>
            </div>
            <div
              className="Ex"
              data-aos="zoom-in"
              style={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <div style={{ width: "100px", height: "100px" }}>
                <img
                  alt="companylogo"
                  style={{ maxWidth: "80%", maxHeight: "80%" }}
                  src={require("../Icons/Icons-07.png")}
                />
              </div>
              <div className="ExpSub">
                content <br /> here <br />
                jgdnfbxfn
                <br /> ngdngd <br />
                jgfj
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const MainDiv = {
  marginTop: "70px",
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

const Content = {
  fontSize: "25px",
  color: "black",
};

const WorkExdivs = {
  padding: "5%",
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  justifyContent: "center",
  borderBottom: "1px solid #ffd56f",
};
export default ExperienceResp;
